import React from 'react';

const styles = {
  container: {
    display: 'flex',
  },
  card: {
    width: '50%',
  },
}

export default function Portfolio() {
  return (
    <div style={styles.container} class='container'>
      <div style={styles.card} class="card">
        <img src="https://picsum.photos/200/300" alt="project 1" />
      </div>
      <div style={styles.card} class="card">
        <img src="https://picsum.photos/200/300" alt="project 1" />
      </div>
      <div style={styles.card} class="card">
        <img src="https://picsum.photos/200/300" alt="project 1" />
      </div>
      <div style={styles.card} class="card">
        <img src="https://picsum.photos/200/300" alt="project 1" />
      </div>
      <div style={styles.card} class="card">
        <img src="https://picsum.photos/200/300" alt="project 1" />
      </div>
    </div>
  );
}
